import './Header.css'
import React from 'react'

function Header () {
    return (
        <nav>
            <div className='header-logo'>
                <a>OUT</a>
            </div>
            <li>
                <a>Collection</a>
                <a>Echantillons</a>
                <a>Salles d'exposition</a>
                <a>A propos de nous</a>
            </li>
        </nav>
    );
}

export default Header;
